  let x = props.x;
  let y = props.y;
  let z = props.x;

  // let {x,y,z} = props

  return (
    <>
      {x === y && y === z ? <Matching x={x} y={y} z={z}/> : <NotMatching x={x} y={y} z={z}/>}
      
      
    {/* if(x===y && y===z){
